import React from 'react';
import HeaderApp from './HeaderApp';
import ControlEstadisticas from './estadisticas/ControlEstadisticas';

const ConfiguracionVisualizador = () => {
    const estiloConfiguracion = {
        backgroundColor: '#D8D8D8', // Color de fondo
        padding: '20px', // Agrega un poco de espacio alrededor del contenido
        height: 'calc(100vh - 64px)', // Altura total de la ventana menos la altura del HeaderApp
        overflowY: 'scroll', // Activa el desplazamiento vertical
    };

    return (
        <div>
            <HeaderApp /> {/* Instancia el componente HeaderApp */}
            <div style={estiloConfiguracion}>
                <div className='row'>
                    <div className='col-12'>
                        <ControlEstadisticas />
                    </div>
                </div>
                {/* Aquí puedes añadir el contenido de la página de configuración del visualizador */}
                <div className='row'>
                    <div className='col-12'>
                        <h2>Configuración del Visualizador</h2>
                        <p>Aquí se mostrarán opciones y herramientas para configurar el visualizador...</p>
                        {/* Inserta elementos interactivos, formularios, etc. */}
                    </div>
                </div>
                {/* Repite para más elementos según sea necesario */}
                {/* ... */}
            </div>
        </div>
    );
};

export default ConfiguracionVisualizador;
